webpackJsonp([0x70b8e676af6b],{3932:function(e,o){e.exports={data:{markdownRemark:{html:"<h2>Google Cloud Platform</h2>\n<p>Google Cloud Platform, offered by Google, is a suite of cloud computing services that runs on the same infrastructure that Google uses internally for its end-user products, such as Google Search and YouTube.[1] Alongside a set of management tools,\nit provides a series of modular cloud services including computing, data storage, data analytics and machine learning.</p>\n<p>Some famous web services include</p>\n<ul>\n<li>Google Compute Engine – IaaS providing virtual machines.</li>\n<li>Google App Engine – PaaS for application hosting.</li>\n<li>Bigtable – IaaS massively scalable NoSQL database.</li>\n<li>BigQuery – SaaS large scale database analytics.</li>\n<li>Google Cloud Functions – As of August 2017 is in beta testing. FaaS providing serverless functions to be triggered by cloud events.</li>\n<li>Google Cloud Datastore - DBaaS providing a document-oriented database.</li>\n<li>Cloud Pub/Sub - a service for publishing and subscribing to data streams and messages. Applications can communicate via Pub/Sub, without direct integration between the applications themselves.[5]</li>\n<li>Google Storage - IaaS providing RESTful online file and object storage.</li>\n</ul>\n<h4>More Information:</h4>\n<!-- Please add any articles you think might be helpful to read before writing the article -->\n<ul>\n<li><a href='https://en.wikipedia.org/wiki/Google_Cloud_Platform' target='_blank' rel='nofollow'>Wikipedia</a></li>\n</ul>",fields:{slug:"/cloud-development/google cloud/"},frontmatter:{title:"Google Cloud Platform"}}},pathContext:{slug:"/cloud-development/google cloud/"}}}});
